import React from 'react';
import { Route } from 'react-router-dom';
import './App.css';

import HomePage from './pages/homepage/homepage.component';

function App() {
  return (
        <div>
            <Route exact path='/' componenet={HomePage} />
        </div>
  );
}

export default App;
